# yaml-language-server: $schema=.schema.yaml
title: Viral dynamics of acute SARS-CoV-2 infection and applications to diagnostic
  and public health strategies
doi: 10.1371/journal.pbio.3001333
description: >
  This study followed 68 people (90% male) during the NBA 2019 to 2020 season with
  frequent RT-qPCR to map SARS-CoV-2 viral RNA trajectories and 46 had acute infections.
  A single low Ct (<30) strongly indicates acute infection, and a second PCR within
  48 hours helps tell whether someone is early (proliferation) or late (clearance)
  in infection.
analytes:
  AN_OPS_SARSCoV2_ct:
    description: >
      SARS-CoV-2 RNA gene copy concentration in combined anterior nares and oropharyngeal
      swabs. Results were reported in cycle threshold (Ct) values.
    specimen:
    - anterior_nares_swab
    - oropharyngeal_swab
    biomarker: SARS-CoV-2
    gene_target: N1, N2, RdRp
    limit_of_quantification: unknown
    limit_of_detection: 40
    unit: cycle threshold
    reference_event: confirmation date
  AN_OPS_SARSCoV2_viral:
    description: >
      Estimated SARS-CoV-2 RNA genome copy concentration measured from combined anterior
      nares and oropharyngeal swab specimens. Viral load was derived by the study
      authors by transforming the corresponding Ct values using a Bayesian model implemented
      in Stan, and results are reported in genome copies per milliliter.
    specimen:
    - anterior_nares_swab
    - oropharyngeal_swab
    biomarker: SARS-CoV-2
    gene_target: N1, N2, RdRp
    limit_of_quantification: unknown
    limit_of_detection: unknown
    unit: gc/mL
    reference_event: confirmation date
